import { BrowserRouter, Route, Routes} from 'react-router-dom';
import {Link} from 'react-router-dom';
import User from './userRoute/home';
import React from 'react';
import mainBTN from './mainBTN.css';

function App() {
  return (
    <body>
      <h1>P:LOW</h1>
      <Routes>
        <Route path='/' element={<div>
          <button className="main-btn">사용자</button>
          <button className="main-btn">조회 기관</button>
          <button className="main-btn">헌혈 기관</button>
        </div>} />
      </Routes>
    </body>
  );
}

export default App;
